import ContactSection from "./components/contact/contact";
import Hero from "./components/hero"
import Projects from "./components/project/list"
import Skills from "./components/skills/skills";

const App = ()=>{
    return (
        <>
            <Hero/><br />
            <Skills/>
            <Projects></Projects>
            <ContactSection/>
            
        </>
    )
}
export default App;
